import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

function Fam(props){
  return(
    <div>
   <h1>my name is {props.name} {props.cast}</h1>
   <h1> my age is {props.age}</h1>
  
    </div>
  )
}





ReactDOM.render(
   <>
  
   <Fam name="mujjkir" age="22" cast="ansari" />
   <Fam name="sikandar" age="22" cast="tagala" />
   <Fam name="asif" age="22" cast="khan" />
   <Fam name="amir" age="22" cast="ansari" />

    </>
 ,document.getElementById("root"));
